import React, { useEffect } from "react";
import moment from "moment";
import axios from "axios";

export default function NewsFeed() {
  console.log(moment().format());

  const currentDate = moment().format("YYYY-MM-DD");
  console.log(currentDate);
  //get ids for all coins listed and adds them to "coinData" (an array stored in state)
  useEffect(() => {
    axios
      .get(
        //list all coins (tens of thousands)
        "https://newsapi.org/v2/everything?q=crypto&from=&language=en&apiKey=69563e91b17745efad0051f4c02a3f94"
      )
      .then((response) => {
        const data = response.data;
        console.log(data);
      });
  });

  return <div>NewsFeed</div>;
}
